// UAAServer is the server API for UAA service.
type UAAServer interface {
	// 检查账号是否存在
	CheckAccountExist(context.Context, *commim_uaa.CheckAccountExistReq) (*commim_uaa.CheckAccountExistRsp, error)
	// 获取手机验证码，每日限制次数，输入图形验证码
	SendPhoneCode(context.Context, *commim_uaa.SendPhoneCodeReq) (*pb_pub.CommRsp, error)
	// 获取邮箱验证码，每日限制次数，输入图形验证码
	SendEmailCode(context.Context, *commim_uaa.SendEmailCodeReq) (*pb_pub.CommRsp, error)
	// 注册
	Signup(context.Context, *commim_uaa.SignupReq) (*commim_uaa.SignupRsp, error)
	// Login .
	Login(context.Context, *commim_uaa.LoginReq) (*commim_uaa.LoginRsp, error)
	// UpdateUserInfo .
	UpdateUserInfo(context.Context, *commim_uaa.UpdateUserInfoReq) (*commim_uaa.UpdateUserInfoRsp, error)
	// UserInfo .
	UserInfo(context.Context, *commim_uaa.UserInfoReq) (*commim_uaa.UserInfoRsp, error)
	// 使用账号，手机，邮箱中的一个
	FindUserInfoIntell(context.Context, *commim_uaa.FindUserInfoIntellReq) (*commim_uaa.UserInfoRsp, error)
	// 投诉建议
	AddSuggest(context.Context, *commim_uaa.AddSuggestReq) (*commim_uaa.AddSuggestRsp, error)
	GetSuggestList(context.Context, *commim_uaa.GetSuggestListReq) (*commim_uaa.GetSuggestListRsp, error)
	GetSuggestDetail(context.Context, *commim_uaa.GetSuggestDetailReq) (*commim_uaa.GetSuggestDetailRsp, error)
	AddSuggestReply(context.Context, *commim_uaa.AddSuggestReplyReq) (*commim_uaa.AddSuggestReplyRsp, error)
	GetSuggestReplyList(context.Context, *commim_uaa.GetSuggestReplyListReq) (*commim_uaa.GetSuggestReplyListRsp, error)
	SetSuggestStatus(context.Context, *commim_uaa.SetSuggestStatusReq) (*commim_uaa.SetSuggestReplyStatusRsp, error)
	// 版本管理，自动更新
	CheckVersion(context.Context, *commim_uaa.CheckVersionReq) (*commim_uaa.CheckVersionRsp, error)
	FetchEndPoint(context.Context, *commim_uaa.FetchEndPointReq) (*commim_uaa.FetchEndPointRsp, error)
	CheckDelay(context.Context, *commim_uaa.CheckDelayReq) (*commim_uaa.CheckDelayRsp, error)
	// 查询系统配置
	GetSysCfg(context.Context, *commim_uaa.GetSysCfgReq) (*commim_uaa.GetSysCfgRsp, error)
	// IM检查账号正确性
	ImLoginConfirm(context.Context, *commim_uaa.ImLoginConfirmReq) (*commim_uaa.ImLoginConfirmRsp, error)
	// 忘记密码重新设置密码
	ResetPassword(context.Context, *commim_uaa.ResetPasswordReq) (*commim_uaa.ResetPasswordRsp, error)
	// 注销账号
	Unregister(context.Context, *commim_uaa.UnregisterReq) (*pb_pub.CommRsp, error)
	// 添加地址
	AddAddress(context.Context, *commim_uaa.AddAddressReq) (*commim_uaa.AddAddressRsp, error)
	// 删除地址
	DelAddress(context.Context, *commim_uaa.DelAddressReq) (*pb_pub.CommRsp, error)
	// 修改地址
	EditAddress(context.Context, *commim_uaa.EditAddressReq) (*pb_pub.CommRsp, error)
	// 查
	FetchAddress(context.Context, *commim_uaa.FetchAddressReq) (*commim_uaa.FetchAddressRsp, error)
	// 查默认地址
	FetchDefaultAddress(context.Context, *commim_uaa.FetchDefaultAddressReq) (*commim_uaa.FetchDefaultAddressRsp, error)
	// 查
	FetchAddressList(context.Context, *commim_uaa.FetchAddressListReq) (*commim_uaa.FetchAddressListRsp, error)
	// 分组标签操作
	AddCategorizeTag(context.Context, *commim_uaa.AddCategorizeTagReq) (*commim_uaa.AddCategorizeTagRsp, error)
	DelCategorizeTag(context.Context, *commim_uaa.DelCategorizeTagReq) (*pb_pub.CommRsp, error)
	EditCategorizeTag(context.Context, *commim_uaa.EditCategorizeTagReq) (*pb_pub.CommRsp, error)
	FetchCategorizeTagList(context.Context, *commim_uaa.FetchCategorizeTagListReq) (*commim_uaa.FetchCategorizeTagListRsp, error)
	// 分组标签成员操作
	AddCategorizeTagMember(context.Context, *commim_uaa.AddCategorizeTagMemberReq) (*commim_uaa.AddCategorizeTagMemberRsp, error)
	DelCategorizeTagMember(context.Context, *commim_uaa.DelCategorizeTagMemberReq) (*pb_pub.CommRsp, error)
	// 不需要编辑，直接删除就好了
	//
	//	rpc EditCategorizeTagMember(pb_msg_commim_uaa.EditCategorizeTagMemberReq)returns(pb_pub.CommRsp);
	FetchCategorizeTagMemberList(context.Context, *commim_uaa.FetchCategorizeTagMemberListReq) (*commim_uaa.FetchCategorizeTagMemberListRsp, error)
	// /////////////////////
	// 背景图片
	AddBackgroundPic(context.Context, *commim_uaa.AddBackgroundReq) (*commim_uaa.AddBackgroundRsp, error)
	DelBackgroundPic(context.Context, *commim_uaa.DelBackgroundPicReq) (*commim_uaa.DelBackgroundRsp, error)
	FetchBackgroundPicList(context.Context, *commim_uaa.FetchBackgroundPicListReq) (*commim_uaa.FetchBackgroundPicListRsp, error)
	// /////////////////////////
	// 钱包
	WalletGetInfo(context.Context, *commim_uaa.WalletGetInfoReq) (*commim_uaa.WalletGetInfoRsp, error)
	WalletAddValue(context.Context, *commim_uaa.WalletAddValueReq) (*commim_uaa.WalletAddValueRsp, error)
	WalletReduceValue(context.Context, *commim_uaa.WalletReduceValueReq) (*commim_uaa.WalletReduceValueRsp, error)
	WalletSetPassword(context.Context, *commim_uaa.WalletSetPasswordReq) (*pb_pub.CommRsp, error)
	WalletGetChangeFlow(context.Context, *commim_uaa.WalletGetChangeFlowReq) (*commim_uaa.WalletGetChangeFlowRsp, error)
	// ///////////////////////////
	// 签到
	// 获取卡包列表，时间默认倒序
	GetCardPackageItems(context.Context, *commim_uaa.GetCardPackageItemsReq) (*commim_uaa.GetCardPackageItemsRsp, error)
	// 签到
	TaskSignUp(context.Context, *commim_uaa.TaskSignUpReq) (*commim_uaa.TaskSignUpRsp, error)
	// 获取本轮签到最新状态，连续签到的天数
	TaskSignUpStatus(context.Context, *commim_uaa.TaskSignUpStatusReq) (*commim_uaa.TaskSignUpStatusRsp, error)
	// 获取本次签到循环签到信息，任务完成信息
	TaskSignUpInfo(context.Context, *commim_uaa.TaskSignUpInfoReq) (*commim_uaa.TaskSignUpInfoRsp, error)
}

